import './App.css';
import AddProduct from './frontend/add_product';
import { Router, Route, Switch  } from 'react-d';
import ProductList from './frontend/product_list';

function App() {
  return (
    <div>
   <Router>
    <Switch>
      <Route exact path="/add_product" component={AddProduct} />
      <Route path="/product_list" component={ProductList} />
    </Switch>
  </Router>

    </div>
  );
}

export default App;
